import React from 'react'
import styled from 'styled-components'
import style from 'styled-components'

const Black = styled.button`
width: 40px;
height: 130px
position: absolute;
margin: 1px;
nargin-left: -20px;
  background: black;

  :active{
    background: #333;
  }
`

const White = styled.button`
width: 60px;
height: 2000px
position: absolute;
margin: 1px;
  background: white;
  border: 1px solid black;
  box-shadow: 2px 5px;

  :active{
    background: #eee
  }
`

type Props = {
  color: string
  note: string
}

const Note: React.FC<Props> = ({ color, note }) =>
  color == 'white' ? <White value={note} /> : <Black value={note} />

export default Note
